import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'
import styled from 'styled-components'
import Cat from '../cat'
import Cart from '../cart'
export default function Home() {
    const store = useSelector((store: any) => store.array)
    const state = store
    useEffect(() => {
        fetch("https://api.thecatapi.com/v1/images/search?limit=10&page=1&category_ids=1 ")
            .then((response: any) => {
                if (response.ok) return console.log(response.json)
            })
            .catch(error => {
                console.log("Throw new error", error);
            })
    }, [])
    return (
        <Container>
            <Cart />
            {
                state.map((a: any) => (
                    <Cat key={a.id} id={a.id} name={a.name} price={a.price} description={a.description} image={a.image} count={a.count} />
                ))
            }
        </Container>
    )
}

const Container = styled.div`
    display: flex;
    flex-wrap: wrap;
    justify-content: left;
    align-items: center;
    width: 100%;
    max-width: 1324px;
    padding: 40px 0;
    margin: auto;
`
